import eth from "../assets/token/eth.png";
import bnb from "../assets/token/bnb.png";
import btc from "../assets/token/btc.png";
import usd from "../assets/token/usd.png";
import ada from "../assets/token/ada.png";
import sol from "../assets/token/sol.png";

let listToken = [
  {
    name: "ETH",
    logo: eth,
  },
  {
    name: "BNB",
    logo: bnb,
  },
  {
    name: "BTC",
    logo: btc,
  },
  {
    name: "USD",
    logo: usd,
  },
  {
    name: "ADA",
    logo: ada,
  },
  {
    name: "SOL",
    logo: sol,
  },
];

export default listToken;
